import querystring from "querystring"
import IconLetterHeart from "./../Icons/IconLetterHeart"
import IconArrowRight from "./../Icons/IconArrowRight"
import IconPaperPlane from "./../Icons/IconPaperPlane"
import IconError from "./../Icons/IconError"
import IconSpinner from "./../Icons/IconSpinner"
import IconCode from "./../Icons/IconCode"
import Button from "../Button/Button"

export default {
  components: {
    IconLetterHeart,
    IconArrowRight,
    IconPaperPlane,
    IconError,
    IconSpinner,
    IconCode,
    "text-button": Button
  },
  data: function() {
    return {
      email: null,
      state: "default",
      requestInFlight: null,
      url: "https://app.mailerlite.com/webforms/submit/d7i4g7",
      formData: {
        "callback": "jQuery1830520133881537445_1594145870016",
        "ml-submit": "1",
        "ajax": "1",
        "guid": "6ca22b31-4124-e926-cf4f-272ff9f44ec3",
        "_": "1594145875469"
      }
    }
  },
  computed: {
    emailInvalid() {
      const re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
      return !re.test(String(this.email))
    }
  },
  methods: {
    async submit() {
      this.requestInFlight = true
      const urlParams = new URLSearchParams(window.location.search)
      const options = {
        method: "POST",
        mode: "no-cors",
        headers: {
          "Content-Type": "application/x-www-form-urlencoded"
        },
        body: querystring.stringify({
          "fields[email]": this.email,
          ...this.formData
        })
      }
      fetch(this.url, options).then(_ => {
        this.state = "success"
        this.requestInFlight = false
      })
    }
  },
}
